import React, { Component } from 'react';

 Navbar = ({name,interest,age,id})=>{
    const friendsList = friends.map(friend=>{
        return(
           <div>
               <ul key={id}>
                   <li>{name}</li>
                   <li>{friend.interest}</li>
                   <li>{friend.age}</li>
               </ul>
           </div>
        )          
       })

       return(
        <div>
        {friendsList}
        </div>
    )      


}

export default Navbar
